import React, {Component} from 'react';
import {Table} from 'react-bootstrap'; 
import './tourneycss.css';

export class UmpireInfo extends Component {

    constructor(props) {
        super(props);
        this.state ={umpires:[]}
    }

    componentDidMount() {
        this.refreshList(); 
    }
    refreshList() {
        this.setState({
            umpires:[{"WorkingField":1, "UmpireName": "James Black", "NumberOfGames": "21", "PhoneContact": "(989) 529-3545", "EmailContact": "muthblackcoach14U@gmail.com"}, 
            {"WorkingField":1, "UmpireName": "Joe Brown", "NumberOfGames": "18", "PhoneContact": "(989) 529-3545", "EmailContact": "muthblackcoach14U@gmail.com"}

        ]
        })
    }
    render(){

    const {umpires} = this.state; 

        return(
            <div>
            <h2>Umpire Information</h2>

           <Table className="mt-4" stripped bordered hover size="sm">
               <thead>
                    <tr>
                        <th>Working Field</th>
                        <th>Umpire Name</th>
                        <th>Number of Games</th>
                        <th>Phone Contact</th>
                        <th>Email Contact</th>
                    </tr>
               </thead>

               <tbody>
                   {umpires.map(umpire=> 
                        <tr key = {umpire.TournamentID}> 
                            <td>{umpire.TournamentID}</td>
                            <td>{umpireTeamName}</td>
                            <td>{umpire.TeamAgeGroup}</td>
                            <td>{umpire.TeamContact}</td>
                            <td>{umpire.TeamPhoneContact}</td>
                            <td>{umpireTeamEmailContact}</td>
                        </tr>
                        )}
               </tbody>

           </Table>

           </div>
        )


    }
}
